import Head from 'next/head'
import Layout, { siteTitle } from '../components/layout'


import AboutContainer from '../components/aboutContainer/aboutContainer'

import styles from '../styles/page_styles/project.module.scss'
import React from 'react'
import TimeLine from '../components/aboutContainer/timeLine'
import ResponsiveComponent from '../components/responsiveComponent/responsive';
import DesNav from '../components/navBar/NavBar';
import GithubLink from "../components/profile_link/github_link";
//import ImageCarousel from "../components/carousel"
import AwesomeSlider from 'react-awesome-slider';
import AwsSliderStyles from '../styles/page_styles/styles.module.scss';
import process, { browser } from 'process'



const pageTitle: string = siteTitle + " - projects";

export default function Home({
  allPostsData
}: {
  allPostsData: {
    date: string
    title: string
    id: string
  }[]
}) {
  return (

    <div>

      <Head>

        <title>{pageTitle}</title>

      </Head>
      <DesNav />
      <div className={styles.projectContainer}>dd
      {slider}
        <div className={styles.bottomFixed}>
          <a href='/theranos' className={styles.homeButton}>EXPLORE</a>
        </div>

      </div>

    </div>
  )
}

if (process.browser) {

  const a = document.getElementById("AwesomeSlider");

  console.log();
}

const SliderItem = function (input: { char: string }): JSX.Element {
  return (
    <div style={{ height: "100%", backgroundColor: "black", width: "100vw", backgroundSize: "cover", backgroundPosition: "60% 0%" }}>{input.char}</div>
  )
}

const slider = (
  <AwesomeSlider cssModule={AwsSliderStyles} className={styles.aws_btn} fillParent={true}
    selected={0}
    infinite={false}
    bullets={false}
  >

    {SliderItem({ char: "1" })}
    <div style={{ height: "100%", backgroundColor: "black", width: "100vw", backgroundSize: "cover", backgroundPosition: "60% 0%" }}>2</div>

  </AwesomeSlider>
);
